import React from 'react';

function ServiceDesktop({components}) {
    return (
        <div className="row" style={{
            flex: "2",
            alignContent: "flex-start",
            flexWrap: "wrap"
        }}>
            {components(undefined)}
        </div>
    );
}

export default ServiceDesktop;
